INSERT INTO location VALUES (40,'Foster City Radio Tower','','Foster City','San Mateo','CA','Note to photographers: The pond between the dog park and the sewage treatment plant can be a great place for end-of-day shorebird shots as the sun is going down. A slow and stealthy approach can allow you a pretty close, low angle shot of dowitchers and sandpipers. Flights of terns, ducks, shorebirds, and even skimmers are also possible. The dog park might have a porta potty. No entrance fee. ','',37.5424003601,-122.2289962769,0);
