INSERT INTO location VALUES (91,'Sacramento NWR','http://www.r1.fws.gov/sacnwrc/','Sacramento','Glenn','CA','Note to photographers: Take the auto tour route in the winter for some great opportunities for close-up shots at overwintering birds. If lighting permits, be prepared to shoot out both sides of the car, preferably by sitting in back and having someone else drive (thanks, Mary!) Also walk the trees near the parking lots for passerines. Check the trees and ponds near the visitor center, and look for rarity sightings in the notebook inside the visitor center. Bathrooms available. Entrance fee (or buy your federal duck stamp at your local post office).','mapblast',39.3714981079,-122.1819992065,0);
