INSERT INTO location VALUES (141,'Lake Merritt','','Oakland','Alameda','CA','Note to photographers: Many subjects here, including grebes, ducks, and night-herons are highly acclimated to people. Morning light tends to be from the side, makind head angle crucial for duck portraits. Active cormorant rookery in the spring makes an interesting feature for landscape shots. Hard to get down to eye level due to steep banks down to the lake. Lake Merritt is in the middle of an urban area, so parking can be tricky.','',37.8064002991,-122.2539978027,0);
