INSERT INTO location VALUES (164,'Hayward Regional Shoreline','','Hayward','Alameda','CA','Note to photographers: A good place for morning light on shorebirds, be prepared to walk through some muck to get near the water. You\'ll have to work to exclude culverts and other man-made structures from your backgrounds. Look in the trees on the way to the shore for warblers and accipiters. No restrictions on early morning access. No entrance fee.','',37.6499671936,-122.1473464966,0);
